import React from "react";

import FormInput from "../../components/form-input/form-input.component";
import CustomButton from "../../components/custom-button/custom-button.component";

import { EntryDiv } from "./entry.styles";

const options = [
  {
    label: "Severe",
    value: "severe",
  },
  {
    label: "Moderate",
    value: "moderate",
  },
  {
    label: "Mild",
    value: "mild",
  },
];

const Entry = () => {
  return (
    <EntryDiv>
      <form className="entry-form">
        <FormInput
          type="text"
          name="patientId"
          value=""
          onChange=""
          label="Patient ID"
          required
        />
        <FormInput
          type="text"
          name="patientName"
          value=""
          onChange=""
          label="Patient Name"
          required
        />
        <FormInput
          type="text"
          name="currentStatus"
          value=""
          onChange=""
          label="Current status"
          required
        />
        <FormInput
          type="text"
          name="bedNo"
          value=""
          onChange=""
          label="Bed #"
          required
        />
        <CustomButton type="submit">Submit</CustomButton>
      </form>
    </EntryDiv>
  );
};

export default Entry;
